import React from 'react';

function Login() {
  return (
    <div className="flex justify-center items-center min-h-screen bg-cover bg-center" style={{ backgroundImage: "url('/images/login-bg.jpg')" }}>
      <form className="bg-white p-8 rounded shadow-md space-y-4">
        <input type="text" placeholder="Username" className="p-2 border w-full" />
        <input type="password" placeholder="Password" className="p-2 border w-full" />
        <button type="submit" className="w-full bg-purple-600 text-white p-2 rounded hover:bg-purple-700">Login</button>
      </form>
    </div>
  );
}

export default Login;
